import React, { Fragment } from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import { logout } from "../../../actions/auth";
import Logo from "../../../assets/images/logo-white.png";
import SearchIcon from "../../../assets/images/search.png";
import CartIcon from "../../../assets/images/cart.png";
import PeopleIcon from "../../../assets/images/people.png";

const Navbar = ({ logout, auth }) => {
  const authLinks = (
    <Fragment>
      <div className='navbar-right-icons'>
        <div>
          {" "}
          <img src={CartIcon} alt='' />{" "}
        </div>
        <div>
          {" "}
          <img src={PeopleIcon} alt='' />{" "}
        </div>
      </div>
      <div id='navbar-right-display-pic'>
        <div>Hello {auth.user && auth.user.name}</div>
        <a onClick={logout} href='#!'>
          Logout
        </a>
      </div>
    </Fragment>
  );

  const guestLinks = (
    <Fragment>
      <div className='navbar-right-icons'>
        <div>
          <img src={SearchIcon} alt='' />
        </div>
      </div>
      <div id='navbar-right-links'>
        <li>
          <Link to='/register'>Register</Link>
        </li>
        <li>
          <Link to='/login'>Login</Link>
        </li>
      </div>
    </Fragment>
  );

  return (
    <div id='top-navbar'>
      <div id='navbar-left-logo'>
        <Link to='/'>
          <img src={Logo} alt='' />
        </Link>
      </div>
      <div id='navbar-left-links'>
        <li>
          <Link to='/pikcha100'>Pikcha100</Link>
        </li>
        <li>
          <Link to='/artist100'>Artist100</Link>
        </li>
      </div>
      <Fragment>{auth.isAuthenticated ? authLinks : guestLinks}</Fragment>
    </div>
  );
};

const mapStateToProps = state => ({
  auth: state.authReducer
});

export default connect(
  mapStateToProps,
  { logout }
)(Navbar);
